import React from "react";
import { GlobalStyles } from "./styles/global";
import styled from "styled-components";

const Wrapper = styled.section`
  background-color: var(--nav);
  width: 80%;
  height: 2rem;
`;
export default function userNav() {
  return (
    <>
      <Wrapper>
        <GlobalStyles />
      </Wrapper>
    </>
  );
}
